    return <>
        <Form className="login-div">
        <h2>WELCOME TO</h2>
        <h1><CampaignIcon className="speaker" fontSize="60" />Quizz</h1>
        <h5>Register or Login to Enter the quizz world And check your knowledge </h5>
        <input onChnage={handleChange} type="email" name="email" value={user.Email} id="" placeholder="Email" />
        <input onChnage={handleChange} type="password" name="password" value={user.Password} id="" placeholder="Password" /><br/>
        <input onChnage={handleChange} type="password" className="confirm-pass" value={user.Confirmpass} name="confirm-pass" id="" placeholder="Confirm Password" /><br />
        <button>Register</button>
        <h6>Already Have An Account ? <a href={url}>Login Now </a></h6>
        <hr />
        <h6>Continue With Social Media</h6>
        <ul className="socials">
        <li><FacebookIcon /></li>
        <li><TwitterIcon /></li>
        <li><GoogleIcon /></li>
        <li><LinkedInIcon /></li>
        </ul>
        </Form>
    </>
}

export default Register;
